    "# Artistic Weather Data Visualization - Temperature Waves\n",
    "# Requirements: matplotlib, pandas, numpy\n",
    "# Install missing packages in Jupyter with: !pip install matplotlib pandas numpy\n",
    "\n",
    "import pandas as pd\n",
    "import numpy as np\n",
    "import matplotlib.pyplot as plt\n",
    "import matplotlib.animation as animation\n",
    "\n",
    "# ---------------------------\n",
    "# 1. Simulate or Load Weather Data\n",
    "# ---------------------------\n",
    "\n",
    "# Example: generate synthetic temperature data (replace with a real CSV if desired)\n",
    "dates = pd.date_range(start=\"2025-08-01\", periods=30, freq='D')\n",
    "temps = 20 + 10 * np.sin(np.linspace(0, 3*np.pi, len(dates))) + np.random.normal(0, 1.5, len(dates))\n",
    "df = pd.DataFrame({\"Date\": dates, \"Temperature\": temps})\n",
    "\n",
    "# ---------------------------\n",
    "# 2. Normalize Data for Visualization\n",
    "# ---------------------------\n",
    "# Map temperatures to a 0-1 scale for color mapping\n",
    "temp_min, temp_max = df[\"Temperature\"].min(), df[\"Temperature\"].max()\n",
    "df[\"NormTemp\"] = (df[\"Temperature\"] - temp_min) / (temp_max - temp_min)\n",
    "\n",
    "# ---------------------------\n",
    "# 3. Create Artistic Visualization\n",
    "# ---------------------------\n",
    "\n",
    "plt.style.use('dark_background')\n",
    "\n",
    "x = np.linspace(0, 2*np.pi, 200)\n",
    "line, = ax.plot([], [], lw=2)\n",
    "\n",
    "# Setup axis aesthetics\n",
    "ax.set_xlim(0, 2*np.pi)\n",
    "ax.set_ylim(temp_min-5, temp_max+5)\n",
    "ax.set_xticks([])\n",
    "ax.set_yticks([])\n",
    "ax.set_title(\"Temperature Waves\", fontsize=18, color='white')\n",
    "\n",
    "# ---------------------------\n",
    "# 4. Animation Function\n",
    "# ---------------------------\n",
    "def animate(i):\n",
    "    ax.clear()\n",
    "    ax.set_xlim(0, 2*np.pi)\n",
    "    ax.set_ylim(temp_min-5, temp_max+5)\n",
    "    ax.set_xticks([])\n",
    "    ax.set_yticks([])\n",
    "    ax.set_title(\"Temperature Waves\", fontsize=18, color='white')\n",
    "\n",
    "    temp = df.iloc[i % len(df)][\"Temperature\"]\n",
    "    norm = df.iloc[i % len(df)][\"NormTemp\"]\n",
    "\n",
    "    y = temp * np.sin(x + i/5) * np.exp(-0.1 * x) + np.cos(x * 2)\n",
    "    color = plt.cm.coolwarm(norm)\n",
    "    ax.plot(x, y, color=color, lw=3)\n",
    "    ax.fill_between(x, y, y2=-10, color=color, alpha=0.3)\n",
    "    ax.text(0.1, temp_max, f\"{df.iloc[i % len(df)]['Date'].strftime('%Y-%m-%d')}\\n{temp:.1f}°C\", \n",
    "            fontsize=14, color='white')\n",
    "\n",
    "# ---------------------------\n",
    "# 5. Create Animation Object\n",
    "# ---------------------------\n",
    "ani = animation.FuncAnimation(fig, animate, frames=len(df), interval=200)\n",
    "\n",
    "HTML(ani.to_jshtml())"
